If you are using version 5.1 or earlier of MongoDB, you need to define the following custom sortArray() function for inline sorting of the contents of an array field, ready for you to use in a pipeline: // Macro function to generate a complex aggregation expression for sorting an array
// This function isn't required for MongoDB version 5.2+ due to the new $sortArray operator
function sortArray(sourceArrayField) { return { // GENERATE BRAND NEW ARRAY TO CONTAIN THE ELEMENTS FROM SOURCE ARRAY BUT NOW SORTED "$reduce": { "input": sourceArrayField, "initialValue": [], // THE FIRST VERSION OF TEMP SORTED ARRAY WILL BE EMPTY "in": { "$let": { "vars": { // CAPTURE $$this & $$value FROM OUTER $reduce BEFORE OVERRIDDEN "resultArray": "$$value", "currentSourceArrayElement": "$$this" }, "in": { "$let": { "vars": { // FIND EACH SOURCE ARRAY'S CURRENT ELEMENT POSITION IN NEW SORTED ARRAY "targetArrayPosition": { "$reduce": { "input": {"$range": [0, {"$size": "$$resultArray"}]}, // "0,1,2.." "initialValue": { // INITIALISE SORTED POSITION TO BE LAST ARRAY ELEMENT "$size": "$$resultArray" }, "in": { // LOOP THRU "0,1,2..." "$cond": [ {"$lt": [ "$$currentSourceArrayElement", {"$arrayElemAt": ["$$resultArray", "$$this"]} ]}, {"$min": ["$$value", "$$this"]}, // ONLY USE IF LOW VAL NOT YET FOUND "$$value" // RETAIN INITIAL VAL AGAIN AS NOT YET FOUND CORRECT POSTN ] } } } }, "in": { // BUILD NEW SORTED ARRAY BY SLICING OLDER ONE & INSERTING NEW ELEMENT BETWEEN "$concatArrays": [ {"$cond": [ // RETAIN THE EXISTING FIRST PART OF THE NEW ARRAY {"$eq": [0, "$$targetArrayPosition"]}, [], {"$slice": ["$$resultArray", 0, "$$targetArrayPosition"]}, ]}, ["$$currentSourceArrayElement"], // PULL IN THE NEW POSITIONED ELEMENT {"$cond": [ // RETAIN THE EXISTING LAST PART OF THE NEW ARRAY {"$gt": [{"$size": "$$resultArray"}, 0]}, {"$slice": [ "$$resultArray", "$$targetArrayPosition", {"$size": "$$resultArray"} ]}, [], ]}, ] } } } } } } };
} Define the new arrayElemAtPercentile() function for capturing the element of a sorted array at the nth percentile position: // Macro function to find nth percentile element of a sorted version of an array
function arrayElemAtPercentile(sourceArrayField, percentile) { return { "$let": { "vars": { "sortedArray": sortArray(sourceArrayField), // Comment out the line above and uncomment the line below if running MDB 5.2 or greater // "sortedArray": {"$sortArray": {"input": sourceArrayField, "sortBy": 1}}, }, "in": { "$arrayElemAt": [ // FIND ELEMENT OF ARRAY AT NTH PERCENTILE POSITION "$$sortedArray", {"$subtract": [ // ARRAY IS 0-INDEX BASED SO SUBTRACT 1 TO GET POSITION {"$ceil": // FIND NTH ELEMENT IN THE ARRAY, ROUNDED UP TO NEAREST integer {"$multiply": [ {"$divide": [percentile, 100]}, {"$size": "$$sortedArray"} ]} }, 1 ]} ] } } };
} If running MongoDB version 5.2 or greater, you can instead comment/uncomment the specific lines indicated in the code above to leverage MongoDB's new $sortArray operator Define the pipeline ready to perform the aggregation: var pipeline = [ // Capture new fields for the ordered array + various percentiles {"$set": { "sortedResponseTimesMillis": sortArray("$responseTimesMillis"), // Comment out the line above and uncomment the line below if running MDB 5.2 or greater // "sortedResponseTimesMillis": {"$sortArray": {"input": "$responseTimesMillis", "sortBy": 1}}, "medianTimeMillis": arrayElemAtPercentile("$responseTimesMillis", 50), "ninetiethPercentileTimeMillis": arrayElemAtPercentile("$responseTimesMillis", 90), }}, // Only show results for tests with slow latencies (i.e. 90th%-ile responses >100ms) {"$match": { "ninetiethPercentileTimeMillis": {"$gt": 100}, }}, // Exclude unrequired fields from each record {"$unset": [ "_id", "datetime", "responseTimesMillis", ]}, ]; If running MongoDB version 5.2 or greater, you can instead comment/uncomment the specific lines indicated in the code above to leverage MongoDB's new $sortArray operator

