// the number of times it occurs
function arrayGroupByCount(arraySubdocField, groupByKeyField) { return { "$map": { "input": { "$setUnion": { "$map": { "input": `$${arraySubdocField}`, "in": `$$this.${groupByKeyField}` } } }, "as": "key", "in": { "id": "$$key", "count": { "$size": { "$filter": { "input": `$${arraySubdocField}`, "cond": { "$eq": [`$$this.${groupByKeyField}`, "$$key"] } } } } } } };
} // Macro function to generate a complex expression to group an array field's
// content by the value of a field occurring in each array element, summing
// the values from a corresponding amount field in each array element
function arrayGroupBySum(arraySubdocField, groupByKeyField, groupByValueField) { return { "$map": { "input": { "$setUnion": { "$map": { "input": `$${arraySubdocField}`, "in": `$$this.${groupByKeyField}` } } }, "as": "key", "in": { "id": "$$key", "total": { "$reduce": { "input": `$${arraySubdocField}`, "initialValue": 0, "in": { "$cond": { "if": {"$eq": [`$$this.${groupByKeyField}`, "$$key"]}, "then": {"$add": [`$$this.${groupByValueField}`, "$$value"]}, "else": "$$value" } } } } } } };
