In reality, once most developers become adept at using the Aggregation Framework, they tend not to rely on temporary intermediate data sets whilst prototyping each stage. However, it is still a reasonable development approach if you prefer it. Instead, seasoned aggregation pipeline developers typically comment out one or more stages of an aggregation pipeline when using MongoDB's Shell (or they use the "disable stage" capability provided by the GUI tools for MongoDB). To encourage composability and hence productivity, some of the principles to strive for are: Easy disabling of subsets of stages, whilst prototyping or debugging Easy addition of new fields to a stage or new stages to a pipeline by performing a copy, a paste and then a modification without hitting cryptic error messages resulting from issues like missing a comma before the added element Easy appreciation of each distinct stage's purpose, at a glance With these principles in mind, the following is an opinionated list of guidelines for how you should textually craft your pipelines in JavaScript to improve your pipeline development pace: Don't start or end a stage on the same line as another stage For every field in a stage, and stage in a pipeline, include a trailing comma even if it is currently the last item Include an empty newline between every stage For complex stages include a // comment with an explanation on a newline before the stage To "disable" some stages of a pipeline whilst prototyping or debugging another stage, use the multi-line comment /* prefix and */ suffix Below is an example of a poor pipeline layout if you have followed none of the guiding principles: // BAD var pipeline = [ {"$unset": [ "_id", "address" ]}, {"$match": { "dateofbirth": {"$gte": ISODate("1970-01-01T00:00:00Z")} }}//, {"$sort": { // "dateofbirth": -1 //}}, {"$limit": 2}
]; Whereas the following is an example of a far better pipeline layout, where you meet all of the guiding principles: // GOOD var pipeline = [ {"$unset": [ "_id", "address", ]}, // Only match people born on or after 1st January 1970 {"$match": { "dateofbirth": {"$gte": ISODate("1970-01-01T00:00:00Z")}, }}, /* {"$sort": { "dateofbirth": -1, }}, {"$limit": 2}, */
]; Notice trailing commas are included in the code snippet, at both the end of stage level and end of field level. It is worth mentioning that some (but not all) developers take an alternative but an equally valid approach to constructing a pipeline. They decompose each stage in the pipeline into different JavaScript variables, where each stage's variable is defined separately, as shown in the example below: // GOOD var unsetStage = { "$unset": [ "_id", "address", ]}; var matchStage = { "$match": { "dateofbirth": {"$gte": ISODate("1970-01-01T00:00:00Z")}, }}; var sortStage = { "$sort": { "dateofbirth": -1, }}; var limitStage = {"$limit": 2}; var pipeline = [ unsetStage, matchStage, sortStage, limitStage,
]; Furthermore, some developers may take additional steps if they do not intend to transfer the prototyped pipeline to a different programming language: They may choose to decompose elements inside a stage into additional JavaScript variables to avoid code "typos". For instance, to prevent one part of a pipeline incorrectly referencing a field computed earlier in the pipeline due to a misspelling. They may choose to factor out the generation of some boilerplate code , representing a complex set of expressions, from part of a pipeline into a separate JavaScript function. This new function is essentially a macro . They can then reuse this function from multiple places within the main pipeline's code. Whenever the pipeline invokes this function, the pipeline's body directly embeds the returned boilerplate code. The Array Sorting & Percentiles chapter, later in this book, provides an example of this approach. In summary, this book is not advocating a multi-variable approach over a single-variable approach when you define a pipeline. The book is just highlighting two highly composable options. Ultimately it is a personal choice concerning which you find most comfortable and productive.

