Sometimes, you need an aggregation pipeline to mutate or reduce an array field's content for each record. For example: You may need to add together all the values in the array into a total field You may need to retain the first and last elements of the array only You may need to retain only one recurring field for each sub-document in the array ... or numerous other array "reduction" scenarios To bring this to life, imagine a retail orders collection where each document contains an array of products purchased as part of the order, as shown in the example below: [ { _id: 1197372932325, products: [ { prod_id: 'abc12345', name: 'Asus Laptop', price: NumberDecimal('429.99') } ] }, { _id: 4433997244387, products: [ { prod_id: 'def45678', name: 'Karcher Hose Set', price: NumberDecimal('23.43') }, { prod_id: 'jkl77336', name: 'Picky Pencil Sharpener', price: NumberDecimal('0.67') }, { prod_id: 'xyz11228', name: 'Russell Hobbs Chrome Kettle', price: NumberDecimal('15.76') } ] }
] The retailer wants to see a report of all the orders but only containing the expensive products purchased by customers (e.g. having just products priced greater than 15 dollars). Consequently, an aggregation is required to filter out the inexpensive product items of each order's array. The desired aggregation output might be: [ { _id: 1197372932325, products: [ { prod_id: 'abc12345', name: 'Asus Laptop', price: NumberDecimal('429.99') } ] }, { _id: 4433997244387, products: [ { prod_id: 'def45678', name: 'Karcher Hose Set', price: NumberDecimal('23.43') }, { prod_id: 'xyz11228', name: 'Russell Hobbs Chrome Kettle', price: NumberDecimal('15.76') } ] }
] Notice order 4433997244387 now only shows two products and is missing the inexpensive product. One naïve way of achieving this transformation is to unwind the products array of each order document to produce an intermediate set of individual product records. These records can then be matched to retain products priced greater than 15 dollars. Finally, the products can be grouped back together again by each order's _id field. The required pipeline to achieve this is below: // SUBOPTIMAL var pipeline = [ // Unpack each product from the each order's product as a new separate record {"$unwind": { "path": "$products", }}, // Match only products valued over 15.00 {"$match": { "products.price": { "$gt": NumberDecimal("15.00"), }, }}, // Group by product type {"$group": { "_id": "$_id", "products": {"$push": "$products"}, }},
]; This pipeline is suboptimal because a $group stage has been introduced, which is a blocking stage, as outlined earlier in this chapter. Both memory consumption and execution time will increase significantly, which could be fatal for a large input data set. There is a far better alternative by using one of the Array Operators instead. Array Operators are sometimes less intuitive to code, but they avoid introducing a blocking stage into the pipeline. Consequently, they are significantly more efficient, especially for large data sets. Shown below is a far more economical pipeline, using the $filter array operator, rather than the $unwind/$match/$group combination, to produce the same outcome: // OPTIMAL var pipeline = [ // Filter out products valued 15.00 or less {"$set": { "products": { "$filter": { "input": "$products", "as": "product", "cond": {"$gt": ["$$product.price", NumberDecimal("15.00")]}, } }, }},
]; Unlike the suboptimal pipeline, the optimal pipeline will include "empty orders" in the results for those orders that contained only inexpensive items. If this is a problem, you can include a simple $match stage at the start of the optimal pipeline with the same content as the $match stage shown in the suboptimal example. To reiterate, there should never be the need to use an $unwind/$group combination in an aggregation pipeline to transform an array field's elements for each document in isolation. One way to recognise this anti-pattern is if your pipeline contains a $group on a $_id field. Instead, use Array Operators to avoid introducing a blocking stage. Otherwise, you will suffer a magnitude increase in execution time when the blocking group stage in your pipeline handles more than 100 MB of in-flight data. Adopting this best practice may mean the difference between achieving the required business outcome and abandoning the whole task as unachievable. The primary use of an $unwind/$group combination is to correlate patterns across many records' arrays rather than transforming the content within each input record's array only. For an illustration of an appropriate use of $unwind/$group refer to this book's Unpack Array & Group Differently example.

38.body:
As discussed, the database engine will do its best to optimise the aggregation pipeline at runtime, with a particular focus on attempting to move the $match stages to the top of the pipeline. Top-level $match content will form part of the filter that the engine first executes as the initial query. The aggregation then has the best chance of leveraging an index. However, it may not always be possible to promote $match filters in such a way without changing the meaning and resulting output of an aggregation. Sometimes, a $match stage is defined later in a pipeline to perform a filter on a field that the pipeline computed in an earlier stage. The computed field isn't present in the pipeline's original input collection. Some examples are: A pipeline where a $group stage creates a new total field based on an accumulator operator . Later in the pipeline, a $match stage filters groups where each group's total is greater than 1000. A pipeline where a $set stage computes a new total field value based on adding up all the elements of an array field in each document. Later in the pipeline, a $match stage filters documents where the total is less than 50. At first glance, it may seem like the match on the computed field is irreversibly trapped behind an earlier stage that computed the field's value. Indeed the aggregation engine cannot automatically optimise this further. In some situations, though, there may be a missed opportunity where beneficial refactoring is possible by you, the developer. Take the following trivial example of a collection of customer order documents: [ { customer_id: 'elise_smith@myemail.com', orderdate: ISODate('2020-05-30T08:35:52.000Z'), value: NumberDecimal('9999') } { customer_id: 'elise_smith@myemail.com', orderdate: ISODate('2020-01-13T09:32:07.000Z'), value: NumberDecimal('10101') }
] Let's assume the orders are in a Dollars currency, and each value field shows the order's value in cents . You may have built a pipeline to display all orders where the value is greater than 100 dollars like below: // SUBOPTIMAL var pipeline = [ {"$set": { "value_dollars": {"$multiply": [0.01, "$value"]}, // Converts cents to dollars }}, {"$unset": [ "_id", "value", ]}, {"$match": { "value_dollars": {"$gte": 100}, // Peforms a dollar check }},
]; The collection has an index defined for the value field (in cents ). However, the $match filter uses a computed field, value_dollars. When you view the explain plan, you will see the pipeline does not leverage the index. The $match is trapped behind the $set stage (which computes the field) and cannot be moved to the pipeline's start. MongoDB's aggregation engine tracks a field's dependencies across multiple stages in a pipeline. It can establish how far up the pipeline it can promote fields without risking a change in the aggregation's behaviour. In this case, it knows that if it moves the $match stage ahead of the $set stage, it depends on, things will not work correctly. In this example, as a developer, you can easily make a pipeline modification that will enable this pipeline to be more optimal without changing the pipeline's intended outcome. Change the $match filter to be based on the source field value instead (greater than 10000 cents), rather than the computed field (greater than 100 dollars). Also, ensure the $match stage appears before the $unset stage (which removes the value field). This change is enough to allow the pipeline to run efficiently. Below is how the pipeline looks after you have made this change: // OPTIMAL var pipeline = [ {"$set": { "value_dollars": {"$multiply": [0.01, "$value"]}, }}, {"$match": { // Moved to before the $unset "value": {"$gte": 10000}, // Changed to perform a cents check }}, {"$unset": [ "_id", "value", ]}, ]; This pipeline produces the same data output. However, when you look at its explain plan, it shows the database engine has pushed the $match filter to the top of the pipeline and used an index on the value field. The aggregation is now optimal because the $match stage is no longer "blocked" by its dependency on the computed field.

