The previously stated generalisation about $match not supporting expressions is actually inaccurate. Version 3.6 of MongoDB introduced the $expr operator, which you can embed within a $match stage (or in MQL) to leverage aggregation expressions when filtering records. Essentially, this enables MongoDB's query runtime (which executes an aggregation's $match) to reuse expressions provided by MongoDB's aggregation runtime. Inside a $expr operator, you can include any composite expression fashioned from $ operator functions, $ field paths and $$ variables. A few situations demand having to use $expr from inside a $match stage. Examples include: A requirement to compare two fields from the same record to determine whether to keep the record based on the comparison's outcome A requirement to perform a calculation based on values from multiple existing fields in each record and then comparing the calculation to a constant These are impossible in an aggregation (or MQL find()) if you use regular $match query conditions. Take the example of a collection holding information on different instances of rectangles (capturing their width and height), similar to the following: [ { _id: 1, width: 2, height: 8 }, { _id: 2, width: 3, height: 4 }, { _id: 3, width: 20, height: 1 }
] What if you wanted to run an aggregation pipeline to only return rectangles with an area greater than 12? This comparison isn't possible in a conventional aggregation when using a single $match query condition. However, with $expr, you can analyse a combination of fields in-situ using expressions. You can implement the requirement with the following pipeline: var pipeline = [ {"$match": { "$expr": {"$gt": [{"$multiply": ["$width", "$height"]}, 12]}, }},
]; The result of executing an aggregation with this pipeline is: [ { _id: 1, width: 2, height: 8 }, { _id: 3, width: 20, height: 1 }
] As you can see, the second of the three shapes is not output because its area is only 12 (3 x 4).

