Imagine you wanted to process a list of the products ordered by a customer and convert the array of product names to upper case. In a procedural style of JavaScript, you might write the following code to loop through each product in the array and convert its name to upper case: let order = { "orderId": "AB12345", "products": ["Laptop", "Kettle", "Phone", "Microwave"]
}; // Procedural style JavaScript
for (let pos in order.products) { order.products[pos] = order.products[pos].toUpperCase();
} This code modifies the order’s product names to the following, with the product names now in uppercase: {orderId: 'AB12345', products: ['LAPTOP', 'KETTLE', 'PHONE', 'MICROWAVE']} To achieve a similar outcome in an aggregation pipeline, you might use the following: db.orders.insertOne(order); var pipeline = [ {"$set": { "products": { "$map": { "input": "$products", "as": "product", "in": {"$toUpper": "$$product"} } } }}
]; db.orders.aggregate(pipeline); Here, a $map operator expression is applied to loop through each product name in the input products array and add the upper case version of the product name to the replacement output array. This pipeline produces the following output with the order document transformed to: {orderId: 'AB12345', products: ['LAPTOP', 'KETTLE', 'PHONE', 'MICROWAVE']} Using functional style in JavaScript, your looping code would more closely resemble the following to achieve the same outcome: // Functional style JavaScript
order.products = order.products.map( product => { return product.toUpperCase(); }
); Comparing an aggregation $map operator expression to a JavaScript map() array function is far more illuminating to help explain how the operator works.

61.body:
Suppose you wanted to process a list of the products ordered by a customer but produce a single summary string field from this array by concatenating all the product names from the array. In a procedural JavaScript style, you could code the following to produce the product names summary field: let order = { "orderId": "AB12345", "products": ["Laptop", "Kettle", "Phone", "Microwave"]
}; order.productList = ""; // Procedural style JavaScript
for (const pos in order.products) { order.productList += order.products[pos] + "; ";
} This code yields the following output with a new productList string field produced, which contains the names of all the products in the order, delimited by semi-colons: { orderId: 'AB12345', products: [ 'Laptop', 'Kettle', 'Phone', 'Microwave' ], productList: 'Laptop; Kettle; Phone; Microwave; '
} You can use the following pipeline to achieve a similar outcome: db.orders.insertOne(order); var pipeline = [ {"$set": { "productList": { "$reduce": { "input": "$products", "initialValue": "", "in": { "$concat": ["$$value", "$$this", "; "] } } } }}
]; db.orders.aggregate(pipeline); Here, a $reduce operator expression loops through each product in the input array and concatenates each product’s name into an accumulating string. You use the $$this expression to access the current array element's value during each iteration. For each iteration, you employ the $$value expression to reference the final output value, to which you append the current product string (+ delimiter). This pipeline produces the following output where it transforms the order document to: { orderId: 'AB12345', products: [ 'Laptop', 'Kettle', 'Phone', 'Microwave' ], productList: 'Laptop; Kettle; Phone; Microwave; '
} Using a functional approach in JavaScript, you could have used the following code to achieve the same result: // Functional style JavaScript
order.productList = order.products.reduce( (previousValue, currentValue) => { return previousValue + currentValue + "; "; }, ""
); Once more, by comparing the use of the aggregation operator expression ($reduce) to the equivalent JavaScript array function (reduce()), the similarity is more pronounced.

62.body:
Imagine storing data about buildings on a campus where each building document contains an array of rooms with their sizes (width and length). A room reservation system may require finding the first room in the building with sufficient floor space for a particular number of meeting attendees. Below is an example of one building's data you might load into the database, with its array of rooms and their dimensions in metres: db.buildings.insertOne({ "building": "WestAnnex-1", "room_sizes": [ {"width": 9, "length": 5}, {"width": 8, "length": 7}, {"width": 7, "length": 9}, {"width": 9, "length": 8}, ]
}); You want to create a pipeline to locate an appropriate meeting room that produces an output similar to the following. The result should contain a newly added field, firstLargeEnoughRoomArrayIndex, to indicate the array position of the first room found to have enough capacity. { building: 'WestAnnex-1', room_sizes: [ { width: 9, length: 5 }, { width: 8, length: 7 }, { width: 7, length: 9 }, { width: 9, length: 8 } ], firstLargeEnoughRoomArrayIndex: 2
} Below is a suitable pipeline that iterates through the room array elements capturing the position of the first one with a calculated area greater than 60m²: var pipeline = [ {"$set": { "firstLargeEnoughRoomArrayIndex": { "$reduce": { "input": {"$range": [0, {"$size": "$room_sizes"}]}, "initialValue": -1, "in": { "$cond": { "if": { "$and": [ // IF ALREADY FOUND DON'T CONSIDER SUBSEQUENT ELEMENTS {"$lt": ["$$value", 0]}, // IF WIDTH x LENGTH > 60 {"$gt": [ {"$multiply": [ {"$getField": {"input": {"$arrayElemAt": ["$room_sizes", "$$this"]}, "field": "width"}}, {"$getField": {"input": {"$arrayElemAt": ["$room_sizes", "$$this"]}, "field": "length"}}, ]}, 60 ]} ] }, // IF ROOM SIZE IS BIG ENOUGH CAPTURE ITS ARRAY POSITION "then": "$$this", // IF ROOM SIZE NOT BIG ENOUGH RETAIN EXISTING VALUE (-1) "else": "$$value" } } } } }}
]; db.buildings.aggregate(pipeline); Here the $reduce operator is again used to loop and eventually return a single value. However, the pipeline uses a generated sequence of incrementing numbers for its input rather than the existing array field in each source document. The $range operator is used to create this sequence which has the same size as the rooms array field of each document. The pipeline uses this approach to track the array position of the matching room using the $$this variable. For each iteration, the pipeline calculates the array room element's area. If the size is greater than 60, the pipeline assigns the current array position (represented by $$this) to the final result (represented by $$value). The "iterator" array expressions have no concept of a break command that procedural programming languages typically provide. Therefore, even though the executing logic may have already located a room of sufficient size, the looping process will continue through the remaining array elements. Consequently, the pipeline logic must include a check during each iteration to avoid overriding the final value (the $$value variable) if it already has a value. Naturally, for massive arrays containing a few hundred or more elements, an aggregation pipeline will incur a noticeable latency impact when iterating the remaining array members even though the logic has already identified the required element. Suppose you just wanted to return the first matching array element for a room with sufficient floor space, not its index. In that case, the pipeline can be more straightforward, using $filter to trim the array elements to only those with sufficient space and then the $first operator to grab just the first element from the filter. You would use a pipeline similar to the following: var pipeline = [ {"$set": { "firstLargeEnoughRoom": { "$first": { "$filter": { "input": "$room_sizes", "as": "room", "cond": { "$gt": [ {"$multiply": ["$$room.width", "$$room.length"]}, 60 ] } } } } }}
]; db.buildings.aggregate(pipeline); This pipeline produces the following output: [ { _id: ObjectId("637b4b8a86fac07908ef98b3"), building: 'WestAnnex-1', room_sizes: [ { width: 9, length: 5 }, { width: 8, length: 7 }, { width: 7, length: 9 }, { width: 9, length: 8 } ], firstLargeEnoughRoom: { width: 7, length: 9 } }
] In reality, the array of rooms would be likely to also include an ID for each building's room, for example: "room_sizes": [ {"roomId": "Mercury", "width": 9, "length": 5}, {"roomId": "Venus", "width": 8, "length": 7}, {"roomId": "Jupiter", "width": 7, "length": 9}, {"roomId": "Saturn", "width": 9, "length": 8},
] Consequently, firstLargeEnoughRoom: { roomId: "Jupiter", width: 7, length: 9 } would be the first element returned from the filtering pipeline stage, giving you the room's ID, so there would be no need to obtain the array's index for this particular use case. However, the previous example, using the $reduce based pipeline, is helpful for more complicated situations where you do need the index of the matching array element.

63.body:
It is possible to implement the $map behaviour using $reduce to transform an array. This method is more complex, but you may need to use it in some rare circumstances. Before looking at an example of why let's first compare a more basic example of using $map and then $reduce to achieve the same thing. Suppose you have captured some sensor readings for a device: db.deviceReadings.insertOne({ "device": "A1", "readings": [27, 282, 38, -1, 187]
}); Imagine you want to produce a transformed version of the readings array, with the device’s ID concatenated with each reading in the array. You want the pipeline to produce an output similar to the following, with the newly included array field: { device: 'A1', readings: [ 27, 282, 38, -1, 187 ], deviceReadings: [ 'A1:27', 'A1:282', 'A1:38', 'A1:-1', 'A1:187' ]
} You can achieve this using the $map operator expression in the following pipeline: var pipeline = [ {"$set": { "deviceReadings": { "$map": { "input": "$readings", "as": "reading", "in": { "$concat": ["$device", ":", {"$toString": "$$reading"}] } } } }}
]; db.deviceReadings.aggregate(pipeline); You can also accomplish the same with the $reduce operator expression in the following pipeline: var pipeline = [ {"$set": { "deviceReadings": { "$reduce": { "input": "$readings", "initialValue": [], "in": { "$concatArrays": [ "$$value", [{"$concat": ["$device", ":", {"$toString": "$$this"}]}] ] } } } }}
]; db.deviceReadings.aggregate(pipeline); You will see the pipeline has to do more work here, holding the transformed element in a new array and then concatenating this with the "final value" array the logic is accumulating in the $$value variable. So why would you ever want to use $reduce for this requirement and take on this extra complexity? Suppose the mapping code in the stage needs to include a condition to omit outlier readings that signify a device sensor faulty reading (i.e., a -1 reading value). The challenge here when using $map is that for 5 input array elements, 5 array elements will need to be output. However, using $reduce, for an input of 5 array elements, 4 array elements can be output using a pipeline similar to the following: var pipeline = [ {"$set": { "deviceReadings": { "$reduce": { "input": "$readings", "initialValue": [], "in": { "$concatArrays": [ "$$value", {"$cond": { "if": {"$gte": ["$$this", 0]}, "then": [{"$concat": ["$device", ":", {"$toString": "$$this"}]}], "else": [] }} ] } } } }}
]; This time, the output does not include the faulty device reading (`-1'): [ { device: 'A1', readings: [ 27, 282, 38, -1, 187 ], deviceReadings: [ 'A1:27', 'A1:282', 'A1:38', 'A1:187' ] }
] Of course, this being the aggregation framework, multiple ways exist to solve the same problem. Another approach could be to continue with the $map based pipeline and, using the $cond operator, return an empty string ('') for each faulty reading. You would then need to wrap the $map stage in a $filter stage with logic to filter out elements where the element's string length is zero. In summary, you typically use a $map stage when the ratio of input elements to output elements is the same (i.e. many-to-many or M:M ). You employ a $reduce stage when the ratio of input elements to output elements is many-to-one (i.e. M:1 ). For situations where the ratio of input elements is many-to-few (i.e. M:N ), instead of $map, you will invariably reach for $reduce with its "null array concatenation" trick when $filter does not suffice.

64.body:
One of the primary uses of the $map operator expression is to add more data to each existing object in an array. Suppose you've persisted a set of retail orders, where each order document contains an array of order items. Each order item in the array captures the product’s name, unit price, and quantity purchased, as shown in the example below: db.orders.insertOne({ "custid": "jdoe@acme.com", "items": [ { "product" : "WizzyWidget", "unitPrice": 25.99, "qty": 8, }, { "product" : "HighEndGizmo", "unitPrice": 33.24, "qty": 3, } ]
}); You now need to calculate the total cost for each product item (quantity x unitPrice) and add that cost to the corresponding order item in the array. You can use a pipeline similar to the following to achieve this: var pipeline = [ {"$set": { "items": { "$map": { "input": "$items", "as": "item", "in": { "product": "$$item.product", "unitPrice": "$$item.unitPrice", "qty": "$$item.qty", "cost": {"$multiply": ["$$item.unitPrice", "$$item.qty"]}}, } } } }
]; db.orders.aggregate(pipeline); Here, for each element in the source array, the pipeline creates an element in the new array by explicitly pulling in the three fields from the old element (product, unitPrice and quantity) and adding one new computed field (cost). The pipeline produces the following output: { custid: 'jdoe@acme.com', items: [ { product: 'WizzyWidget', unitPrice: 25.99, qty: 8, cost: 187.128 }, { product: 'HighEndGizmo', unitPrice: 33.24, qty: 3, cost: 99.72 } ]
} Similar to the disadvantages of using a $project stage in a pipeline, outlined in an earlier chapter , the $map code is burdened by explicitly naming every field in the array element to retain. You will find this tiresome if each array element has lots of fields. In addition, if your data model evolves and new types of fields appear in the array's items over time, you will be forced to return to your pipeline and refactor it each time to include these newly introduced fields. Just like using $set instead of $project for a pipeline stage, there is a better solution to allow you to retain all existing array item fields and add new ones when you process arrays. A good solution is to employ the $mergeObjects operator expression to combine all existing fields plus the newly computed fields into each new array element. $mergeObjects takes an array of objects and combines the fields from all the array's objects into one single object. To use $mergeObjects in this situation, you provide the current array element as the first parameter to $mergeObjects. The second parameter you provide is a new object containing each computed field. In the example below, the code adds only one generated field, but if you require it, you can include multiple generated fields in this new object: var pipeline = [ {"$set": { "items": { "$map": { "input": "$items", "as": "item", "in": { "$mergeObjects": [ "$$item", {"cost": {"$multiply": ["$$item.unitPrice", "$$item.qty"]}}, ] } } } }}
]; db.orders.aggregate(pipeline); This pipeline produces the same output as the previous "hardcoded field names" pipeline, but with the advantage of being sympathetic to new types of fields appearing in the source array in the future. Instead of using $mergeObjects, there is an alternative and slightly more verbose combination of three different array operator expressions that you can similarly employ to retain all existing array item fields and add new ones. These three operators are: $objectToArray . This converts an object containing different field key/value pairs into an array of objects where each object has two fields: k, holding the field's name, and v, holding the field's value. For example: {height: 170, weight: 60} becomes [{k: 'height', v: 170}, {k: 'weight', v: 60}] $concatArrays . This combines the contents of multiple arrays into one single array result. $arrayToObject . This converts an array into an object by performing the reverse of the $objectToArray operator. For example: {k: 'height', v: 170}, {k: 'weight', v: 60}, {k: 'shoeSize', v: 10}] becomes {height: 170, weight: 60, shoeSize: 10} The pipeline below shows the combination in action for the same retail orders data set as before, adding the newly computed total cost for each product: var pipeline = [ {"$set": { "items": { "$map": { "input": "$items", "as": "item", "in": { "$arrayToObject": { "$concatArrays": [ {"$objectToArray": "$$item"}, [{ "k": "cost", "v": {"$multiply": ["$$item.unitPrice", "$$item.qty"]}, }] ] } } } }} }
]; db.orders.aggregate(pipeline); If this achieves the same as using $mergeObjects but is more verbose, why bother using this pattern? Well, in most cases, you wouldn't. One situation where you would use the more verbose combination is if you need to dynamically set the name of an array item's field, in addition to its value. Rather than naming the computed total field as cost, suppose you want the field's name also to reflect the product's name (e.g. costForWizzyWidget, costForHighEndGizmo). You can achieve this by using the $arrayToObject/$concatArrays/$objectToArray approach rather than the $mergeObjects method, as follows: var pipeline = [ {"$set": { "items": { "$map": { "input": "$items", "as": "item", "in": { "$arrayToObject": { "$concatArrays": [ {"$objectToArray": "$$item"}, [{ "k": {"$concat": ["costFor", "$$item.product"]}, "v": {"$multiply": ["$$item.unitPrice", "$$item.qty"]}, }] ] } } } }} }
]; db.orders.aggregate(pipeline); Below you can see the new pipeline's output. The pipeline has retained all existing array item's fields and added a new field to each item with a dynamically generated name. { custid: 'jdoe@acme.com', items: [ { product: 'WizzyWidget', unitPrice: 25.99, qty: 8, costForWizzyWidget: 207.92 }, { product: 'HighEndGizmo', unitPrice: 33.24, qty: 3, costForHighEndGizmo: 99.72 } ]
} When retaining existing items from an array, plus adding new fields, you can use either approach to override an existing item's field with a new value. For example, you may want to modify the current unitPrice field to incorporate a discount. For both $mergeObjects and $arrayToObject expressions, to achieve this, you provide a re-definition of the field as a subsequent parameter after first providing the reference to the source array item. This tactic works because the last definition wins if the same field is defined more than once with different values.

65.body:
As a final "fun" example, let's see how to employ an $objectToArray operator expression to use reflection to analyse the shape of a collection of documents as part of a custom schema analysis tool. Such reflection capabilities are vital in databases that provide a flexible data model, such as MongoDB, where the included fields may vary from document to document. Imagine you have a collection of customer documents, similar to the following: db.customers.insertMany([ { "_id": ObjectId('6064381b7aa89666258201fd'), "email": 'elsie_smith@myemail.com', "dateOfBirth": ISODate('1991-05-30T08:35:52.000Z'), "accNnumber": 123456, "balance": NumberDecimal("9.99"), "address": { "firstLine": "1 High Street", "city": "Newtown", "postcode": "NW1 1AB", }, "telNums": ["07664883721", "01027483028"], "optedOutOfMarketing": true, }, { "_id": ObjectId('734947394bb73732923293ed'), "email": 'jon.jones@coolemail.com', "dateOfBirth": ISODate('1993-07-11T22:01:47.000Z'), "accNnumber": 567890, "balance": NumberDecimal("299.22"), "telNums": "07836226281", "contactPrefernece": "email", },
]); In your schema analysis pipeline, you use $objectToArray to capture the name and type of each top-level field in the document as follows: var pipeline = [ {"$project": { "_id": 0, "schema": { "$map": { "input": {"$objectToArray": "$$ROOT"}, "as": "field", "in": { "fieldname": "$$field.k", "type": {"$type": "$$field.v"}, } } } }}
]; db.customers.aggregate(pipeline); For the two example documents in the collection, the pipeline outputs the following: { schema: [ {fieldname: '_id', type: 'objectId'}, {fieldname: 'email', type: 'string'}, {fieldname: 'dateOfBirth', type: 'date'}, {fieldname: 'accNnumber', type: 'int'}, {fieldname: 'balance', type: 'decimal'}, {fieldname: 'address', type: 'object'}, {fieldname: 'telNums', type: 'array'}, {fieldname: 'optedOutOfMarketing', type: 'bool'} ]
},
{ schema: [ {fieldname: '_id', type: 'objectId'}, {fieldname: 'email', type: 'string'}, {fieldname: 'dateOfBirth', type: 'date'}, {fieldname: 'accNnumber', type: 'int'}, {fieldname: 'balance', type: 'decimal'}, {fieldname: 'telNums', type: 'string'}, {fieldname: 'contactPrefernece', type: 'string'}
} The difficulty with this basic pipeline approach is once there are many documents in the collection, the output will be too lengthy and complex for you to detect common schema patterns. Instead, you will want to add an $unwind and $group stage combination to accumulate recurring fields that match. The generated result should also highlight if the same field name appears in multiple documents but with different data types. Here is the improved pipeline: var pipeline = [ {"$project": { "_id": 0, "schema": { "$map": { "input": {"$objectToArray": "$$ROOT"}, "as": "field", "in": { "fieldname": "$$field.k", "type": {"$type": "$$field.v"}, } } } }}, {"$unwind": "$schema"}, {"$group": { "_id": "$schema.fieldname", "types": {"$addToSet": "$schema.type"}, }}, {"$set": { "fieldname": "$_id", "_id": "$$REMOVE", }},
]; db.customers.aggregate(pipeline); This pipeline’s output now provides a far more comprehensible summary, as shown below: {fieldname: '_id', types: ['objectId']},
{fieldname: 'address', types: ['object']},
{fieldname: 'email', types: ['string']},
{fieldname: 'telNums', types: ['string', 'array']},
{fieldname: 'contactPrefernece', types: ['string']},
{fieldname: 'accNnumber', types: ['int']},
{fieldname: 'balance', types: ['decimal']},
{fieldname: 'dateOfBirth', types: ['date']},
{fieldname: 'optedOutOfMarketing', types: ['bool']} This result highlights that the telNums field can have one of two different data types within documents. The main drawback of this rudimentary schema analysis pipeline is its inability to descend through layers of arrays and sub-documents hanging off each top-level document. This challenge is indeed solvable using a pure aggregation pipeline, but the code involved is far more complex and beyond the scope of this chapter. If you are interested in exploring this further, the "mongo-agg-schema-analyzer" GitHub project solves this problem. That project shows you how to traverse through hierarchically structured documents using a single aggregation pipeline to infer the schema.

